<h5>ED-00015: Clean Web Search</h5>
<p>This dataset contains the results of comparing web searches across Bing, Google, Yahoo, and Ask.  This data is provided by <a href="http://robert.bredereck.info/">Robert Bredereck</a> at TU:Berlin.  Robert provides tools to compute Kemeny rankings on this data at his <a href="http://fpt.akt.tu-berlin.de/kconsens/README">website at TU Berlin</a>.</p> <p> These data files differ from the other set of <a href="web.php">web data</a> in that these files are forced to be <b>complete.</b>  This means that the results are restricted to only those candidates (sites) that appear in all three datasets.  The data files marked <b>big</b> contain around 200 (max 242) candidates each while the data files marked <b>small</b> contain between 10 and 50 candidates.  The search queries are shown in the names of the individual data files below.  For the WebImpact files the number of search results for a particular term were used to create a complete ranking over the search terms.  These files measure the webimpact of various world cities and countries.  We have extended this data into tournament graphs and weighted majority graphs.</p>

<p><h6>Required Citations</h6><p><ul> 
<li>None.</li></ul></p>

<p><h6>Selected Citations Using This Dataset</h6><p><ul> 
<li> <a href="http://scholar.google.com/scholar?as_q=Theoretical+and+empirical+evaluation+of+data+reduction+for+exact+Kemeny+Rank+Aggregation">Theoretical and empirical evaluation of data reduction for exact Kemeny Rank Aggregation.</a> N. Betzler,  R. Bredereck and R. Niedermeier. Autonomous Agents and Multi-Agent Systems, 28(5):721-748, 2014. </li>
<li> <a href="http://scholar.google.com/scholar?as_q=Fixed-Parameter+Algorithms+for+Computing+Kemeny+scores+-+Theory+and+Practice">Fixed-Parameter Algorithms for Computing Kemeny scores - Theory and Practice.</a> R Bredereck. Thesis, Department of Mathematics and Computer Science, University of Jena, 2009. </li>
<li> <a href="http://scholar.google.com/scholar?as_q=Partial+Kernelization+for+Rank+Aggregation:+Theory+and+Experiments">Partial Kernelization for Rank Aggregation: Theory and Experiments.</a> N. Betzler, R. Bredereck, and R. Niedermeier. Proc. 5th International Symposium on Parameterized and Exact Computation (IPEC '10), 2010. </li>
</ul></p>

